int compute_order_1_ode(double xnorm, double log10abserr, double log10relerr, int* flag_err)
/*
 * this is to determine the 'optimal' degree of the taylor expansion.
 *
 * parameters:
 * xnorm: norm of the initial condition
 * log10abserr: base-10 log of the absolute error required
 * log10relerr: base-10 log of the relative error required
 * flag_err:    flag. returns 1 if absolute error is used
 *                    returns 2 if relative error is used
 *
 * returned value: 'optimal' degree.
*/
{
  double log10eps,tmp;
  int nt;

  log10eps=log10abserr;
  *flag_err=1;
  if (xnorm != (double)0.0)
    {
      tmp=log10relerr+log10(xnorm);
      if (tmp > log10abserr) {log10eps=log10relerr; *flag_err=2;}
    }
/*
  we use 1.16 for the value 0.5*log(10)=1.151292546497...
*/
  nt=(int)(1.5-1.16*log10eps);
  if (nt < 2) nt=2; /* this is the minimum order accepted */

#if DEBUG_LEVEL > 0
      fprintf(stderr, "taylor_step: order is %d\n",nt);
#endif

  return(nt);
}
double compute_stepsize_1_ode(MY_FLOAT **s, MY_JET **jet, int nt, double xnorm, int flag_err)
/*
 * it looks for a step size for an expansion up to order nt. this
 * function requires that nt is the value computed by
 * compute_order_1_
 */
{
  double double_log_MyFloat_ode(MY_FLOAT x);
  static MY_FLOAT z,v1,v2;
  static MY_FLOAT of,uf;
  double lnv1,lnv2,r,lnro1,lnro2,lnro;
  int i;
  static int init=0;
#pragma omp threadprivate(z,v1,v2,of,uf,init)

  if (init == 0)
    {
      init=1;
      InitMyFloat(z);
      InitMyFloat(v1);
      InitMyFloat(v2);
      InitMyFloat(of);
      InitMyFloat(uf);

      r=pow((double)2,(double)LEXP2);
      MakeMyFloatA(of,r);
      r=pow((double)2,(double)(-LEXP2));
      MakeMyFloatA(uf,r);
    }
/*
  we compute the sup norm of the last two coefficients of the taylor
  series, and we store them into v1 and v2.
*/
  MakeMyFloatA(v1,0);
  MakeMyFloatA(v2,0);
#if _J_DIM_ != 0
  for (i=0; i<_J_DIM_; i++)
  {
    xNormJet(z,jet[i][nt-1]);
    if (MyFloatA_GT_B(z,v1)) AssignMyFloat(v1,z);
    xNormJet(z,jet[i][nt]);
    if (MyFloatA_GT_B(z,v2)) AssignMyFloat(v2,z);
  }
#endif
  for(i=_J_DIM_; i<_N_DIM_; i++)
  {
    fabsMyFloatA(z,s[i][nt-1]);
    if (MyFloatA_GT_B(z,v1)) AssignMyFloat(v1,z);
    fabsMyFloatA(z,s[i][nt]);
    if (MyFloatA_GT_B(z,v2)) AssignMyFloat(v2,z);
  }
/*
  computation of the step size. we need the logs of v1 and v2, in
  double precision (there is no need for extended precision). the idea
  is to assign these variables to double variables and then to use the
  standard log function. before doing that, we have to be sure that v1
  can be assigned to a double without under or overflow. for this
  reason we will check for this condition and, if it fails, we will
  call an specific function for this case.
*/
  if (MyFloatA_LE_B(v1,of) && MyFloatA_GE_B(v1,uf))
    {
      MyFloatToDouble(r,v1);
      lnv1=log(r);
    }
    else
    {
      lnv1=double_log_MyFloat_ode(v1);
    }
  if (MyFloatA_LE_B(v2,of) && MyFloatA_GE_B(v2,uf))
    {
      MyFloatToDouble(r,v2);
      lnv2=log(r);
    }
    else
    {
      lnv2=double_log_MyFloat_ode(v2);
    }
  if(lnv1 == 65536.0 || lnv2 == 65536.0 ) return 0.0; //changeme
/*
  if flag_err == 2, this means that we are using a relative error control.
*/
  if (flag_err == 2)
    {
      r = -log10(xnorm);
      lnv1 += r;
      lnv2 += r;
    }
 lnro1= -lnv1/(nt-1);
 lnro2= -lnv2/nt;
 lnro=(lnro1 < lnro2)? lnro1: lnro2;

 r=exp(lnro-2-0.7/(nt-1)); /* exp(-0.7/(nt-1)) is a security factor */
  return(r);
}
double compute_stepsize_2_ode(MY_FLOAT **s, MY_JET **jet, int nt, double xnorm, int flag_err)
/*
 * it looks for a step size for an expansion up to order nt. this
 * function requires that nt is the value computed by
 * compute_order_1_. it also tries to reduce cancellations of big
 * terms in the summation of the taylor series.
 */
{
  double compute_stepsize_1_ode(MY_FLOAT**, MY_JET**, int, double, int);
  static MY_FLOAT h,hj,r,z,a,normj;
  double c,rtmp,dh;
  int i,j;
  static int init=0;
#pragma omp threadprivate(h,hj,r,z,a,normj,init)

  if (init == 0)
    {
      init=1;
      InitMyFloat(h); 
      InitMyFloat(hj);
      InitMyFloat(r);
      InitMyFloat(z);
      InitMyFloat(a);
      InitMyFloat(normj);
    }
/*
  we compute the step size according to the first algorithm
*/
  dh=compute_stepsize_1_ode(s,jet,nt,xnorm,flag_err);
  if(dh == 0.0) return  0.0; // changeme
  MakeMyFloatA(h,dh);
/*
  next lines select a value (z), that will be used to control the size
  of the terms of the Taylor series.
*/
  if (flag_err == 1) {
     MakeMyFloatA(z, 1.0);
  } else if (flag_err == 2) {
    MakeMyFloatA(z,xnorm);
  } else
    {
      printf("compute_stepsize_2 internal error. flag_err: %d\n",flag_err);
      exit(1);
    }
/*
  next loop checks if the sup norm of the terms in the Taylor series are
  lower than z. if a term is greater than z, the step size h is reduced.
*/
  MakeMyFloatA(hj,(double)1.0);

  for(j=1; j<=nt; j++)
  {
    MultiplyMyFloatA(r,h,hj);
    AssignMyFloat(hj,r);

    MakeMyFloatC(normj,"0", (double)0);
#if _J_DIM_ != 0
    for (i=0; i<_J_DIM_; i++)
    {
      xNormJet(a,jet[i][j]);
      if (MyFloatA_GT_B(a,normj)) AssignMyFloat(normj,a);
    }
#endif
    for (i=_J_DIM_; i<_N_DIM_; i++)
    {
      fabsMyFloatA(a,s[i][j]);
      if (MyFloatA_GT_B(a,normj)) AssignMyFloat(normj,a);
    }

    MultiplyMyFloatA(r,normj,hj);
    if (MyFloatA_LE_B(r,z)) continue;
/*
    we reduce h (and hj)
*/
    DivideMyFloatA(hj,z,normj);

    DivideMyFloatA(a,r,z);
    MyFloatToDouble(c,a);
    c=pow(c,(double)1.e0/(double)j);
    MakeMyFloatA(a,c);
    DivideMyFloatA(r,h,a);
    AssignMyFloat(h,r);

#if DEBUG_LEVEL > 1
    fprintf(stderr, "order %2d. reducing h from %14.6e to %14.6e\n",j,c*h,h);
#endif
  }

  MyFloatToDouble(rtmp,h);
  return(rtmp);
}

double double_log_MyFloat_ode(MY_FLOAT x)
/*
 * natural log, in double precision, of a MY_FLOAT positive number.
 */
{
  static MY_FLOAT a,tmp;
  static MY_FLOAT z,of,uf;
  double b,lx;
  int k;
  static int init=0;
#pragma omp threadprivate(a,tmp,z,of,uf,init)

  if (init == 0)
    {
      init=1;
      InitMyFloat(a);
      InitMyFloat(z);
      InitMyFloat(of);
      InitMyFloat(uf);
      InitMyFloat(tmp);

      b=0;
      MakeMyFloatA(z,b);
      b=pow((double)2,(double)LEXP2);
      MakeMyFloatA(of,b);
      b=pow((double)2,(double)(-LEXP2));
      MakeMyFloatA(uf,b);
    }

  if (MyFloatA_EQ_B(x,z))
    {
      puts("double_log_MyFloat error: zero argument");
      puts("(this is because one of the last two terms of your taylor");
      puts(" expansion is exactly zero)");
      /*exit(1);*/
      return 65536.0;
    }

  AssignMyFloat(a,x);

  k=0;
  while(MyFloatA_LT_B(a,uf))
  {
    ++k;
    if(k>3000){fprintf(stderr,"double_log_MyFloat overflow: %d\n", k); /*exit(1);*/ return 65536.0;}
     MultiplyMyFloatA(tmp,a,of);
    AssignMyFloat(a,tmp);
  }
  while(MyFloatA_GT_B(a,of))
  {
    --k;
    if(k<-3000){fprintf(stderr,"double_log_MyFloat underflow: %d\n", k); /*exit(1);*/ return 65536.0;}
     MultiplyMyFloatA(tmp,a,uf);
    AssignMyFloat(a,tmp);
  }

  MyFloatToDouble(b,a);
/*
  lx stands for log(x)
*/
  lx=log(b)-(LEXP2*0.69314718055994530942)*k;

  return(lx);
}

int taylor_uniform_step_ode_tag(
			     MY_FLOAT *ti,
			     MY_FLOAT *x,
			     int      dir,
			     int      step_ctl,
			     double   log10abserr,
			     double   log10relerr,
			     MY_FLOAT *endtime,
			     MY_FLOAT *ht,
			     int      *order,
			     MY_JET   *jetInOut,
			     int tag)
/*
 *  Solve ODE on an equally spaced time grid.
 *
 *  parameters:  same as those in taylor_step_ode 
 *  except the meaning of 'ht' changed.
 *
 *   *ht is not changed by this stepper (except make sure it is positive),
 *   it is used to form a uniform time grid.  In other words, the stepper
 *   will compute solutions on t0, t0+h, t0+2h, ... .  h = *ht or -*ht
 *   depending on dir=1 or -1.
 *   
 *  If step_ctl=0, this stepper is the same as taylor_step_ode
 *  Otherwise, it internally use taylor_step_ode with possibly
 *  very large steps, and evaluate the taylor polynomail on the time grid.
 *  
 *  tag: when integrate multiple orbits, tag specifies which orbit we are
 *  integrating. One still has to integrate consecutively b/c static vars
 *  are used. 
 */
{
  static MY_FLOAT last_t0, last_t1, target_t, last_h, working_t, working_h, the_h;
  static MY_FLOAT last_x0[_N_DIM_+1], last_x1[_N_DIM_+1], **last_s, mtmp, h0, zer0;
  static MY_JET   last_jet0[_J_DIM_+1], last_jet1[_J_DIM_+1], **last_j, jtmp;
  static int init=0, last_order, last_tag=-1;
  int i,j,k,nt, ans, compute, ended;
#pragma omp threadprivate(last_t0,last_t1,target_t,last_h,working_t,working_h, the_h) 
#pragma omp threadprivate(last_x0,last_x1,last_s,mtmp,h0,zer0)
#pragma omp threadprivate(last_jet0,last_jet1,last_j,jtmp)
#pragma omp threadprivate(init,last_order, last_tag)  
  
  if(step_ctl == 0)
    return  taylor_step_ode(ti, x, dir, step_ctl, log10abserr, log10relerr, endtime, ht, order, jetInOut);

  compute = 0;
  if(init == 0) {
    init = 1;
    last_s = NULL;
    last_j = NULL;
    InitMyFloat(mtmp);InitMyFloat(h0); InitMyFloat(the_h);
    InitMyFloat(zer0); MakeMyFloatA(zer0,0.0);   
    InitMyFloat(last_t0);InitMyFloat(last_t1);
    InitMyFloat(working_t);InitMyFloat(working_h);
    InitMyFloat(last_h); InitMyFloat(target_t);
    xInitUpJet();
    for(i=0;i<=_N_DIM_;i++) {
      InitMyFloat(last_x0[i]); InitMyFloat(last_x1[i]);      
    }
    for(i=0;i<=_J_DIM_;i++)  {
      xInitJet(last_jet0[i]); xInitJet(last_jet1[i]);      
    }
    xInitJet(jtmp);    
    compute = 1;    
  } // init == 0

  if(last_tag != tag) {
    AssignMyFloat(last_t1, *ti);
    AssignMyFloat(last_t0, *ti);
    AssignMyFloat(last_h, *ht);        
#if _J_DIM_ != 0
    for(i=0; i<_J_DIM_; i++) {
      xAssignJetToJet(last_jet0[i],jetInOut[i]);
      xAssignJetToJet(last_jet1[i],jetInOut[i]);	
    }
#endif
    for(i=_J_DIM_; i<_N_DIM_; i++) {
      AssignMyFloat(last_x0[i],x[i]);
      AssignMyFloat(last_x1[i],x[i]);	
    }
    if(MyFloatA_LT_B(*ht, zer0)) {
      NegateMyFloatA(the_h, *ht);
    } else {
      AssignMyFloat(the_h, *ht);      
    }
    compute = 1;
    last_tag=tag;
  }
  
  if(dir == -1) {
    SubtractMyFloatA(target_t, *ti, the_h);
    if(MyFloatA_LT_B(target_t,last_t1)) {  
      compute = 1;
    }
  } else {
    AddMyFloatA(target_t, *ti, the_h);
    if(MyFloatA_GT_B(target_t,last_t1)) {  
      compute = 1;
    }
  }

  ans = 0;
  if(compute) {
    // set solver to start at the last computed point on orbit
    AssignMyFloat(working_t, last_t1);
    AssignMyFloat(working_h, last_h);    
#if _J_DIM_ != 0
    for(i=0; i<_J_DIM_; i++) {
      xAssignJetToJet(jetInOut[i],last_jet1[i]);
    }
#endif
    for(i=_J_DIM_; i<_N_DIM_; i++) {
      AssignMyFloat(x[i],last_x1[i]);
    }
    
    do {
#if _J_DIM_ != 0
      for(i=0; i<_J_DIM_; i++) {
	xAssignJetToJet(last_jet0[i],jetInOut[i]);
      }
#endif
      for(i=_J_DIM_; i<_N_DIM_; i++) {
	AssignMyFloat(last_x0[i],x[i]);
      }
      AssignMyFloat(last_t0,working_t);
      ans = taylor_step_ode_Twelve(&working_t, x, dir, step_ctl, log10abserr, log10relerr, endtime, &working_h, &nt, jetInOut, &last_s, &last_j);
      last_order = nt;
      if (order) *order = nt;
      if( ans < 0 ) {
	AssignMyFloat(last_t1, working_t);	
	break;
      } else {
	if( (dir == 1 && MyFloatA_GE_B(working_t, target_t)) || (dir == -1 && MyFloatA_LE_B(working_t, target_t))) {
	  AssignMyFloat(last_t1, working_t);
	  AssignMyFloat(last_h, working_h);	  
#if _J_DIM_ != 0
	  for(i=0; i<_J_DIM_; i++) {
	    xAssignJetToJet(last_jet1[i],jetInOut[i]);
	}
#endif
	  for(i=_J_DIM_; i<_N_DIM_; i++) {
	    AssignMyFloat(last_x1[i],x[i]);
	  }
	  break;
	}
      }
    } while( ans == 0);
  }

  if(ans == 1) {
    ans = 0;
  }
  ended = 0;  
  // evaluate last taylor polynomial -- start
  if(ans == 0) {
    AssignMyFloat(mtmp, target_t);
    if(dir == -1) {
      if(endtime && MyFloatA_LE_B(mtmp, *endtime)) {
	AssignMyFloat(mtmp, *endtime);
	ended = 1;	
      }
    } else {
      if(endtime && MyFloatA_GE_B(mtmp, *endtime)) {
	AssignMyFloat(mtmp, *endtime);
	ended = 1;
      }
    }
    SubtractMyFloatA(h0, mtmp, last_t0);          
    nt = last_order;
    j=nt-1;
#if _J_DIM_ != 0
      for(i=0; i<_J_DIM_; i++)
	{
	  xAssignJetToJet(jetInOut[i],last_j[i][nt]);
	  for(k=j; k>=0; k--)
	    {
	      xMultiplyFloatJetA(jtmp, h0, jetInOut[i]);
	      xAddJetJetA(jetInOut[i], jtmp, last_j[i][k]);
	    }
	  xAssignJetToFloat(x[i],jetInOut[i]);
	}
#endif
      for(i=_J_DIM_; i<_N_DIM_; i++)
	{
	  AssignMyFloat(x[i],last_s[i][nt]);
	  for(k=j; k>=0; k--)
	    {
	      MultiplyMyFloatA(mtmp, h0, x[i]);
	      AddMyFloatA(x[i], mtmp, last_s[i][k]);
	    }
	}
  }
  // evaluate last taylor polynomial -- end
  
  if(ans == 0) {
    if(ended) {
      AssignMyFloat(*ti, *endtime);
      ans = 1;
    } else {
      AddMyFloatA(*ti, last_t0, h0); // advance ti, do not change *ht
    }
  }
  return(ans);
}
