void jet_tree_set_sq_ode(jet_tree_t_ode s, jet_tree_t_ode a)
{
  // assert(s && a); // assert(s != a);
  // assert(*s && *a);

  mycoef_t *a0, *sc, *sf;
  sc = jet_tree_get_zero_coef_ode_node(s);
  a0 = jet_tree_get_zero_coef_ode_node(a);
  mycoef_mul2((*sc),(*a0),(*a0));

  int i, j, k, ord=jet_tree_deg_ode;
  if (ord % 2)
    {
      i = ord;
      /* odd case */
      jet_tree_set_zero_ode_node(s[i], sc,sf);
      k = i/2;
      for (j = 0; j <= k; ++j) jet_tree_pph_ode_node(s+i, a+j, a+(i-j));
      jet_tree_mul2_si_ode_node(s[i], s[i], 2, sc,sf,a0);
      --ord;
    }
  for (i = 1; i <= ord; ++i)
    {
       /* odd case */
      jet_tree_set_zero_ode_node(s[i], sc,sf);
      k = i/2;
      for (j = 0; j <= k; ++j) jet_tree_pph_ode_node(s+i, a+j, a+(i-j));
      jet_tree_mul2_si_ode_node(s[i], s[i], 2, sc,sf,a0);

      ++i;

      /* even case */
      jet_tree_set_zero_ode_node(s[i], sc,sf);
      k = i/2;
      for (j = 0; j < k; ++j) jet_tree_pph_ode_node(s+i, a+j, a+(i-j));
      jet_tree_mul2_si_ode_node(s[i], s[i], 2, sc,sf,a0);
      jet_tree_pph_ode_node(s+i, a + k, a + k);
    }
}

void jet_tree_mul2_ode(jet_tree_t_ode s, jet_tree_t_ode a, jet_tree_t_ode b)
{
// assert(s && a && b); // assert(s != a && s != b);
// assert(*s && *a && *b);
  int i, j;
  mycoef_t *sc,*sf;

  if (a == b) {jet_tree_set_sq_ode(s,a); return;}
  for (i = 0; i <= jet_tree_deg_ode; ++i)
    {
      jet_tree_set_zero_ode_node(s[i], sc,sf);
      for (j = 0; j <= i; ++j)
        {jet_tree_pph_ode_node(s+i, a+j, b+(i-j));}
    }
}

void jet_tree_div2_ode(jet_tree_t_ode s, jet_tree_t_ode a, jet_tree_t_ode b)
{
  // assert(s && a && b); // assert(s != b);
  // assert(*s && *a && *b);
  mycoef_t *b0, *sc,*sf,*sc1;
  int i, j;
  sc = jet_tree_get_zero_coef_ode_node(a);
  b0 = jet_tree_get_zero_coef_ode_node(b);
  sf = jet_tree_get_zero_coef_ode_node(s);
  mycoef_div2(*sf,*sc,*b0);
  for (i = 1; i <= jet_tree_deg_ode; ++i)
    {
      jet_tree_set_ode_node(s+i, a+i);
      for (j = 0; j < i; ++j) {jet_tree_mph_ode_node(s+i, s+j, b + (i-j));}
      jet_tree_div2_coef_ode_node(s[i], s[i],(*b0), sc,sf,sc1);
    }
}

