void jet_tree_set_tan_ode(jet_tree_t_ode t, jet_tree_t_ode a)
{
  int j,k,ii,jj ,nk;
  mycoef_t *t0,*tcf,*tc;
  mycoef_set_tan(*jet_tree_get_zero_coef_ode_node(t),*jet_tree_get_zero_coef_ode_node(a));
  mycoef_mul2(*jet_tree_get_zero_coef_ode_node(jet_tree_jaux_ode),*jet_tree_get_zero_coef_ode_node(t),*jet_tree_get_zero_coef_ode_node(t));

  nk = (jet_tree_deg_ode+1) - ((jet_tree_deg_ode+1)%2==0);
  for (k = 1; k < nk; k++) {
    jet_tree_set_zero_ode_node(t[k], tc,tcf);
    for (j = 0; j < k; j++) 
    {jet_tree_pph_si_ode_node(t+k,k-j,a+(k-j),jet_tree_jaux_ode+j);}
    jet_tree_div2_si_ode_node(t[k],t[k],k, tc,tcf,t0);
    jet_tree_add2_ode_node(t+k,t+k,a+k);

    /* k odd */
    jet_tree_set_zero_ode_node(jet_tree_jaux_ode[k], tc,tcf);
    for (j = 0; j <= (k-1)/2; j++)
    {jet_tree_pph_ode_node(jet_tree_jaux_ode+k,t+j,t+(k-j));}
    jet_tree_mul2_si_ode_node(jet_tree_jaux_ode[k],jet_tree_jaux_ode[k],2, tc,tcf,t0);

    ++k;

    jet_tree_set_zero_ode_node(t[k], tc,tcf);
    for (j = 0; j < k; j++) 
    {jet_tree_pph_si_ode_node(t+k,k-j,a+(k-j),jet_tree_jaux_ode+j);}
    jet_tree_div2_si_ode_node(t[k],t[k],k, tc,tcf,t0);
    jet_tree_add2_ode_node(t+k,t+k,a+k);

    /* k even */
    jet_tree_set_zero_ode_node(jet_tree_jaux_ode[k], tc,tcf);
    for (j = 0; j <= (k-2)/2; j++)
    {jet_tree_pph_ode_node(jet_tree_jaux_ode+k,t+j,t+(k-j));}
    jet_tree_mul2_si_ode_node(jet_tree_jaux_ode[k],jet_tree_jaux_ode[k],2, tc,tcf,t0);

    j = k/2;
    jet_tree_pph_ode_node(jet_tree_jaux_ode+k,t+j,t+j);
  }
  if ((jet_tree_deg_ode+1)%2==0) {
    k = jet_tree_deg_ode;
    jet_tree_set_zero_ode_node(t[k], tc,tcf);
    for (j = 0; j < k; j++) 
    {jet_tree_pph_si_ode_node(t+k,k-j,a+(k-j),jet_tree_jaux_ode+j);}
    jet_tree_div2_si_ode_node(t[k],t[k],k, tc,tcf,t0);
    jet_tree_add2_ode_node(t+k,t+k,a+k);
  }

//  fprintf(stderr,"%s:%d to test\n",__FILE__,__LINE__); exit(1);
}
void jet_tree_set_atan_ode(jet_tree_t_ode t, jet_tree_t_ode a)
{
  int j,k,ii,jj;
  mycoef_t *t0,*tcf,*tc;
  mycoef_set_atan(*jet_tree_get_zero_coef_ode_node(t),*jet_tree_get_zero_coef_ode_node(a));
  jet_tree_set_sq_ode(jet_tree_jaux_ode,a);
  jet_tree_add2_si_ode(jet_tree_jaux_ode,jet_tree_jaux_ode,1);
  for (k = 1; k <= jet_tree_deg_ode; k++) {
    jet_tree_set_zero_ode_node(t[k], tc,tcf);
    for (j = 1; j < k; j++) 
    {jet_tree_pph_si_ode_node(t+k, j, jet_tree_jaux_ode+(k-j), t+j);}
    jet_tree_div2_si_ode_node(t[k],t[k],k, tc,tcf,t0);
    jet_tree_sub2_ode_node(t+k,a+k,t+k);
    jet_tree_div2_coef_ode_node(t[k],t[k],*jet_tree_get_zero_coef_ode_node(jet_tree_jaux_ode), tc,tcf,t0);
  }
//  fprintf(stderr,"%s:%d to test\n",__FILE__,__LINE__); exit(1);
}

