/* special functions */

static jet_tree_t_ode jet_tree_compoh_ode_node(jet_tree_ptr_ode_node h, jet_tree_t_ode *v)
{
  int n, k, m;
  jet_tree_t_ode x1, xk, tmp1, tmp2;
  
  n = h->nsymb;
  k = h->deg;
  x1 = v[n-1];
  
  if (k == 0) {
    tmp1 = jet_tree_pool_ode[jet_tree_ipool_ode]; ++jet_tree_ipool_ode;
    jet_tree_set_coef_ode(tmp1, *(h->coef));
  } else if (n==1) {
    tmp1 = jet_tree_pool_ode[jet_tree_ipool_ode]; ++jet_tree_ipool_ode;
    xk = jet_tree_pool_ode[jet_tree_ipool_ode]; ++jet_tree_ipool_ode;
    jet_tree_set_ode(xk, x1);
    for (m = 1; m < k; ++m)
      {
        /* xk = xk * x1 */
        jet_tree_mul2_ode(tmp1, xk, x1);
//        aprods(tmp1, xk, x1);
        
        tmp2 = xk;
        xk = tmp1;
        tmp1 = tmp2;
      }
    jet_tree_set_ode(jet_tree_jaux_ode, xk);
    jet_tree_mul2_coef_ode(xk, jet_tree_jaux_ode, *(h->coef));
    jet_tree_pool_ode[--jet_tree_ipool_ode] = tmp1;
    return xk;
  } else {
      xk = jet_tree_pool_ode[jet_tree_ipool_ode]; ++jet_tree_ipool_ode;
      tmp1 = jet_tree_compoh_ode_node((h->term)+k, v);
      for (m = k; m > 0; --m)
        {
          jet_tree_mul2_ode(xk, tmp1, x1);
//          aprods(xk, tmp1, x1);
          jet_tree_pool_ode[--jet_tree_ipool_ode] = tmp1;
          tmp1 = jet_tree_compoh_ode_node((h->term) + m-1, v);
          jet_tree_add2_ode(tmp1, tmp1, xk);
        }
      jet_tree_pool_ode[--jet_tree_ipool_ode] = xk;
    }
  return tmp1;
//  fprintf(stderr, "%s:%d to implement\n", __FILE__, __LINE__); fflush(stderr); exit(1);
}

/* Given u(s1,...,sd) and v=(v1,...,vd)
 * series vector of d variables.
 * It outputs w = u(v1,...,vd) serie of d variables.
 * 
 * Note: It allocates a pool of d+1 series possibly
 *  given auxiliary parameter
 */

void jet_tree_compo_ode(jet_tree_t_ode w, jet_tree_t_ode u, jet_tree_t_ode *v)
{
  int m, k;
  jet_tree_t_ode tmp=NULL;
  
  k = jet_tree_get_deg_ode();
  jet_tree_set_zero_ode(w);
  for (m = k; m > 0; --m)
    {
      tmp = jet_tree_compoh_ode_node(u+m, v);
      jet_tree_add2_ode(w, w, tmp);
      jet_tree_pool_ode[--jet_tree_ipool_ode] = tmp;
    }
  mycoef_add2(*jet_tree_get_zero_coef_ode_node(w),*jet_tree_get_zero_coef_ode_node(w),*jet_tree_get_zero_coef_ode_node(u));
}
void jet_tree_reverse_ode(jet_tree_t_ode *u, jet_tree_t_ode *v)
{
  int m, n, k, i, ns = _NUMBER_OF_MAX_SYMBOLS_;
  jet_tree_t_ode tmp=NULL, *tmp2=&jet_tree_pool_ode[ns+1];
  
  for (i = 0; i < ns; ++i)
    {
      jet_tree_set_zero_ode(u[i]);
      jet_tree_set_ode_node(&u[i][0], &v[i][0]);
      jet_tree_set_ode_node(&u[i][1], &v[i][1]);
      
      jet_tree_set_zero_ode(tmp2[i]);
    }
  
  jet_tree_ipool_ode = 0;
  k = jet_tree_get_deg_ode();
  for (m = 2; m <= k; ++m)
    {
      for (n = m; n > 0; --n) for (i = 0; i < ns; ++i)
        {
          tmp = jet_tree_compoh_ode_node(&v[i][n], u);
          jet_tree_add2_ode(tmp2[i], tmp2[i], tmp); /* it could just be homog */
          jet_tree_pool_ode[--jet_tree_ipool_ode] = tmp;
        }
      for (i = 0; i < ns; ++i)
        {
          //jet_tree_set_ode_node(&u[i][m], &tmp2[i][m]);
          jet_tree_neg_ode_node(&u[i][m], &tmp2[i][m]);
          jet_tree_set_zero_ode(tmp2[i]);
        }
    }
}
void jet_tree_algT_ode(jet_tree_t_ode *w, jet_tree_t_ode *u, jet_tree_t_ode *v)
{
  int m, n, k, i, ns = _NUMBER_OF_MAX_SYMBOLS_;
  jet_tree_t_ode tmp=NULL, *tmp2=&jet_tree_pool_ode[ns+1];
  
  for (i = 0; i < ns; ++i)
    {
      jet_tree_set_zero_ode(w[i]);
//      jet_tree_set_zero_ode_node(&w[i][0]);
      jet_tree_set_ode_node(&w[i][1], &u[i][1]);
      
      jet_tree_set_zero_ode(tmp2[i]);
    }
  
  jet_tree_ipool_ode = 0;
  k = jet_tree_get_deg_ode();
  for (m = 2; m <= k; ++m)
    {
      for (n = m; n > 0; --n) for (i = 0; i < ns; ++i)
        {
          tmp = jet_tree_compoh_ode_node(&v[i][n], w);
          jet_tree_add2_ode(tmp2[i], tmp2[i], tmp); /* it could just be homog */
          jet_tree_pool_ode[--jet_tree_ipool_ode] = tmp;
        }
      for (i = 0; i < ns; ++i)
        {
          jet_tree_sub2_ode_node(&w[i][m], &u[i][m], &tmp2[i][m]);
          jet_tree_set_zero_ode(tmp2[i]);
        }
    }
}

